def return_binary_or_hexa(numbers):
    a = numbers[20]
    b = numbers[200]
    missing_nums = set(range(a + 1, b)) - set(numbers[21:200])
    missing_sum = sum(missing_nums)
    if missing_sum == 0:
        return ''
    elif missing_sum % 2 == 1:
        return bin(missing_sum)[2:]
    else:
        return hex(missing_sum)[2:].upper()
